import { Routes, Route } from 'react-router-dom';
import React from 'react';
import './App.css';
import { Link } from 'react-router-dom';
import About from './Pages/About'
import Resume from './Pages/Resume'
import AboutButton from './Button/AboutButton';
import ResumeButton from './Button/ResumeButton';
import { Button } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';


function App() {
  const navigate = useNavigate();
  return (
    <div className="App">
      <header>
        <div style={{ position: 'relative', minHeight: '50px', border: '1px solid', background:  '#685050'}}>
          <Button style={{position: 'relative', right: '700px', top:'15px'}}
          onClick={() => navigate("/")}>Accueil</Button>
          <AboutButton />
          <ResumeButton />
          <br/>
        </div>
      </header>
      <main>
        <Routes>
          <Route path="/" element={<div />} />
          <Route path="/about" element={<About />} />
          <Route path="/resume" element={<Resume />} />
        </Routes>
      </main>{/* 
